import styled from "@emotion/styled";

const Button = styled.button`
  padding: 32px;
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  color: black;
  font-weight: bold;
  &:hover {
    color: white;
  }
`;
class Header extends Component {
  render() {
    return (
      <div>
        <Button>d</Button>
      </div>
    );
  }
}

export default Header;
